import logo from './logo.svg';
import './App.css';
import './style.css';

function TheContent(props){
    return (
	<>
	    <div>
	    <h1> {props.heading} </h1>
	    </div>
	    <div dangerouslySetInnerHTML={{__html: props.articleContent}}>

	</div>
	    </>

    );
}

function App() {
    return (
	<>
	    <div>
	    <h1> Hey </h1>
	    </div>
	    <div>
	    <p> sup </p>
	    </div>
	</>
    );
}

export default App;
